INSERT  IGNORE INTO `faqs` (`id`, `Channel_id`, `QuestionCode`, `Question`, `Answer`, `Status_id`, `FaqCategory_Id`, `createdby`, `modifiedby`, `createdts`, `lastmodifiedts`, `synctimestamp`, `softdeleteflag`) VALUES ('FAQ_ID1','CH_ID_MOB_INT','FAQ_732018175000','What do I need to Enroll for mobile and online banking?','To Enroll, you need to idenitfy yourself by providing: \n1. Last Name\n2. SSN \n3. Date of Birth \nThen validate with a Secure Access Code or Card CVV','SID_ACTIVE','FAQ_CAT_ID1','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID10','CH_ID_MOB_INT','FAQ_732018175001','How can I update my contact details registered with the bank?','You can update your phone numbers, email ids and addresses registered with the bank from the Profile section of the mobile and online banking apps','SID_ACTIVE','FAQ_CAT_ID8','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID11','CH_ID_MOB_INT','FAQ_732018175102','Can I transfer money to own accounts in the same bank','Yes, you can transfer money within your eligible accounts in the bank from the mobile and online banking applications','SID_ACTIVE','FAQ_CAT_ID4','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID12','CH_ID_MOB_INT','FAQ_732018175303','How can I verify my accounts in external accounts for Fund Transfers?','You can use the following options: \n1. Provide your netbbanking credentials of the bank for which the account is being added - Instant verification\n2. Enter the trial deposits amount values that were deposited in the external account - Takes up to 2 days','SID_ACTIVE','FAQ_CAT_ID4','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID13','CH_ID_MOB_INT','FAQ_732018175304','Can I pay my loan dues from the mobile and online banking apps?','Yes, you can pay your loan due amount from the online banking application. You can view your due amount and make partial or full payment of the amount due.','SID_ACTIVE','FAQ_CAT_ID4','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID14','CH_ID_MOB_INT','FAQ_732018175305','What types of fund transfers are supported with the mobile and online banking applications?','You can make the following types of fund transfers: \n1. To your own accounts in the same bank\n2. To others in the same bank\n3. To your own or other accounts in different banks\n4. Wire Transfers (Domestic/International)','SID_ACTIVE','FAQ_CAT_ID4','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID15','CH_ID_MOB_INT','FAQ_732018175306','Can I set up recurring or future dated transfer?','Yes. You can schedule future-dated transfers. Recurring transfers can be made at regular intervals, such as daily, weekly, every 2 weeks, monthly, etc.','SID_ACTIVE','FAQ_CAT_ID4','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID16','CH_ID_MOB_INT','FAQ_732018175307','Can I cancel a scheduled transfer?','Yes, you can cancel a scheduled transfer. It will cancel and stop all the pending transfers in case of recurring transactions','SID_ACTIVE','FAQ_CAT_ID4','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID17','CH_ID_MOB_INT','FAQ_732018175308','How can I communicate with the bank from the mobile and online banking applications?','You can send messages to the bank in a secure method from the mobile and online banking applications','SID_ACTIVE','FAQ_CAT_ID9','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID18','CH_ID_MOB_INT','FAQ_732018175309','Can I send attachments with my messages to the bank from the app?','Yes, you can send up to 5 attachments per message. Each attachment can have a maximum size of 1 MB. ','SID_ACTIVE','FAQ_CAT_ID9','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID19','CH_ID_MOB_INT','FAQ_732018175310','What types of attachments are supported in the messages?','The application supports the following file types: txt\ndoc\ndocx\npdf','SID_ACTIVE','FAQ_CAT_ID9','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID2','CH_ID_MOB_INT','FAQ_732018174711','What are the login options available for the mobile banking app?','You can use the following options: \n1. Username and Password, \n2. Login PIN, \n3. Facial Recognition \n4. Fingerprint/Touch ID on supported devices','SID_ACTIVE','FAQ_CAT_ID1','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID20','CH_ID_MOB_INT','FAQ_732018175312','What is bill payments?','Bill Pay is an online service that allows you to pay your bills through mobile/online banking. You can set up one-time payments, schedule future payments or create recurring payments.','SID_ACTIVE','FAQ_CAT_ID5','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID21','CH_ID_MOB_INT','FAQ_732018175313','How do I register a new biller in mobile/online banking?','To register a new biller follow the below steps:\r 1. Login into mobile/online banking application\r 2. Select \"Pay a bill\" ---> Add New Payee\r 3. Provide required biller details and add the payee','SID_ACTIVE','FAQ_CAT_ID5','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID22','CH_ID_MOB_INT','FAQ_732018175314','Is there a limit to the number of bills I can pay online?','No. There is no limit in the number of bills you can pay online','SID_ACTIVE','FAQ_CAT_ID5','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID23','CH_ID_MOB_INT','FAQ_732018175315','How can I stop a scheduled payment?','Yes, you can cancel a scheduled payment. Go to scheduled payments list in bill pay and find the cancel option to stop a payment','SID_ACTIVE','FAQ_CAT_ID5','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID24','CH_ID_MOB_INT','FAQ_732018175316','Can I delete a registered biller from my account?','Yes, you can delete a registered biller. Deleting a biller will stop scheduled payments and all the payments under process for that biller.','SID_ACTIVE','FAQ_CAT_ID5','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID25','CH_ID_MOB_INT','FAQ_732018175317','What can I use Pay a Person for?','You can use Pay a Person to send or request payment from others. Below are some examples where you can use pay a person\r \r 1. Send a monetary gift to family or friends\r 2. Pay back a friend or co-worker\r 3. Pay vendors such as your baby sitter, gardener, or landlord\r 4. Request money from a friend or family member','SID_ACTIVE','FAQ_CAT_ID6','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID26','CH_ID_MOB_INT','FAQ_732018175318','How do I add a new person as my recipient?','To add a new payee follow the below steps:\r 1.Login into mobile/online banking application\r 2. Go to \"Pay a person\" and select \"Add Recipient\"\r 3.Enter Name, phone number or email id and click\"Add\"','SID_ACTIVE','FAQ_CAT_ID6','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID27','CH_ID_MOB_INT','FAQ_732018175319','How does send work in pay a person?','To send money to someone, enter their name, e-mail address or mobile phone number, the amount you want to send, and a transaction note. Follow the instructions to complete the payment/transfer. The funds will automatically be withdrawn from your account and sent electronically to their account.','SID_ACTIVE','FAQ_CAT_ID6','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID28','CH_ID_MOB_INT','FAQ_732018175320','How does receive work in pay a person?','To request money from someone, enter their name, e-mail address or mobile phone number, the amount requested, and a personal message. Follow the instructions to complete the payment/transfer request.They will receive a notification and instructions on how to complete the payment.Once they confirm, the funds will automatically be debited from their account and credited to your account.','SID_ACTIVE','FAQ_CAT_ID6','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID29','CH_ID_MOB_INT','FAQ_732018175321','Can I edit or delete a payee from my registered payee list?','Yes. You can edit or delete a payee. Go to \"Pay a person\" and choose \"Manage Recipient\". \r 1. To Delete, click delete and confirm to remove a payee from your list.\r 2. To edit, click on edit, change the required details and update. Confirm the same to save the changes.','SID_ACTIVE','FAQ_CAT_ID6','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID3','CH_ID_MOB_INT','FAQ_732018175422','What are the login options available for the online banking application?','You can use your username and password to log into the online banking app','SID_ACTIVE','FAQ_CAT_ID1','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID30','CH_ID_MOB_INT','FAQ_732018175323','Can I schedule a send / request for a payee?','Yes. You can schedule a send / request money transfer by choosing a future date for the transaction','SID_ACTIVE','FAQ_CAT_ID6','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID31','CH_ID_MOB_INT','FAQ_732018175324','Can I schedule a recurring send to a payee?','Yes. You can schedule a transaction, choose the frequency (Daily, Monthly, Weekly, etc) and specify the end date or duration to stop the recurrence.','SID_ACTIVE','FAQ_CAT_ID6','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID32','CH_ID_MOB_INT','FAQ_732018175325','Where can I find my account statement?','Login into your mobile/online banking application. Select the required acccount and choose \"Account Statements\". Select the required period to get the account statement for that period','SID_ACTIVE','FAQ_CAT_ID10','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID33','CH_ID_MOB_INT','FAQ_732018175326','Can I schedule an account statement to my email?','No, you can\'t schedule an accout statement to your email','SID_ACTIVE','FAQ_CAT_ID10','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID34','CH_ID_MOB_INT','FAQ_732018175327','Can I download my account statement?','Yes. You have the options to download, print or send the statement to an email','SID_ACTIVE','FAQ_CAT_ID10','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID35','CH_ID_MOB_INT','FAQ_732018175328','Can I get my account statement for any period?','Yes. Mention the start and end date to download statement for the required period','SID_ACTIVE','FAQ_CAT_ID10','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID36','CH_ID_MOB_INT','FAQ_732018175329','What are the formats in which I can download the statement?','Excel, PDF and Quicken are the formats in which you can download your account statement. ','SID_ACTIVE','FAQ_CAT_ID10','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID37','CH_ID_MOB_INT','FAQ_732018175330','Can I request for a card from my mobile/online banking application?','Yes. You can place a request for a new card from your mobile / online banking application','SID_ACTIVE','FAQ_CAT_ID3','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID38','CH_ID_MOB_INT','FAQ_732018175331','What are different card management options available online','Following are the options availabe to manage your card online:\n1. Change Pin\n2. Lock Card\n3. Replace Card\n4. Cancel Card\n5. Report Stolen/Lost','SID_ACTIVE','FAQ_CAT_ID3','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID39','CH_ID_MOB_INT','FAQ_732018175332','How can I change my debit/credit card PIN online?','Login into your mobile/online banking application. Go to \"Manage Card\" section, select the required card and select \"Change Pin\" option. Provide the reason for chaning the pin and confirm your request. You will receive a mail with new pin','SID_ACTIVE','FAQ_CAT_ID3','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID4','CH_ID_MOB_INT','FAQ_732018174833','I forgot my username. How can I log into the app?','Click on Forgot and provide the information to identify yourself; Validate your identity with the Secure Access Code or Card CVV. If validated correctly, you will be able to retreive your username','SID_ACTIVE','FAQ_CAT_ID1','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID40','CH_ID_MOB_INT','FAQ_732018175334','I have lost my card. How can I report it online?','Login into your mobile/online banking application. Go to \"Manage Card\" section, select the required card. Select Report stolen/lost option. You have options to either call customer care directly or to log a report online.','SID_ACTIVE','FAQ_CAT_ID3','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID41','CH_ID_MOB_INT','FAQ_732018175335','Can I withdraw my stolen/lost report online to reactivate my card?','No, you can\'t withdraw stolen/lost report online.','SID_ACTIVE','FAQ_CAT_ID3','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID42','CH_ID_MOB_INT','FAQ_732018175336','If I lock my card can I unlock in again online?','Yes. You can unlock your locked card online with mobile/online banking application. The card can then be used to perform all transactions','SID_ACTIVE','FAQ_CAT_ID3','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID43','CH_ID_MOB_INT','FAQ_732018175337','Can I use my debit/credit card to pay billsin online banking?','Yes. Login into your mobile/online banking and register with your card details to make bill payments','SID_ACTIVE','FAQ_CAT_ID3','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID44','CH_ID_MOB_INT','FAQ_732018175338','Is it safe to bank and pay bills online?','When you register for online banking, you create a unique username and password.So you and only you can access your accounts. Kindly ensure that you do not write it down in any form or share it with anyone.You are responsible for protecting your password, account details and for providing prompt notification in case of an unauthorized transaction.','SID_ACTIVE','FAQ_CAT_ID7','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID45','CH_ID_MOB_INT','FAQ_732018175339','How is online banking security measured?','Online Banking uses industry-standard security protocols that leverage encryption for transferring data. Encryption helps create a secure environment for the information being transferred between your browser and Bank of America.\r The protocols protect data through Authentication, Encryption and Data integrity','SID_ACTIVE','FAQ_CAT_ID7','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID46','CH_ID_MOB_INT','FAQ_732018175340','How does the security protocols protect data?','These protocols protect data in 3 key ways:\r\n1. Authentication ensures that you are communicating with the bank only and protects impersonation by another computer\r\n2. Encryption scrambles transferred data so that it cannot be read by unauthorized parties\r\n3. Data integrity, in terms of data and network security, assures that information can only be accessed and modified by those authorized to do so','SID_ACTIVE','FAQ_CAT_ID7','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID47','CH_ID_MOB_INT','FAQ_732018175341','Is it secure to do online/mobile banking outside my country?','Yes, you can do online/mobile banking from anywhere in the world with the same level of security','SID_ACTIVE','FAQ_CAT_ID7','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID48','CH_ID_MOB_INT','FAQ_732018175342','Is it safe to access online banking feature from multiple computers','Yes, you can access online banking feature from multiple computers with the same level of security. ','SID_ACTIVE','FAQ_CAT_ID7','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID49','CH_ID_MOB_INT','FAQ_732018175343','Is it safe to use mobile browser to do online banking?','Yes, it is safe to do online banking on mobile browser. However, it is recommended that you logout and close your browser after performing online banking','SID_ACTIVE','FAQ_CAT_ID7','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID5','CH_ID_MOB_INT','FAQ_732018175344','I forgot my password. How can I log into the app?','Click on Forgot and provide the information to identify yourself; Validate your identity with the Secure Access Code or Card CVV. If validated correctly, you will be able to reset your password','SID_ACTIVE','FAQ_CAT_ID1','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID50','CH_ID_MOB_INT','FAQ_732018175345','I share my computer with someone who also uses Online Banking. Can both of us sign in from this computer?','Yes. You can both use the same computer to sign in to your individual online banking account safely; you won\'t see each other\'s information. There\'s no limit to how many people can sign in to online banking from the same computer. Just remember not to share your Username and Password.','SID_ACTIVE','FAQ_CAT_ID7','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID6','CH_ID_MOB_INT','FAQ_732018175346','Why do I see only some of my accounts on the dashboard?','Only accounts marked as Favorites are listed on the Dashboard screen. Favorite accounts are indicated with a filled in star next to the account name on the dashbaord list. Select the option \"Show All Accounts\" to view the remaining accounts. Click on the star next to an account to add it to Favorites or remove it from Favorites. ','SID_ACTIVE','FAQ_CAT_ID2','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID7','CH_ID_MOB_INT','FAQ_732018175547','Which account types are listed in the mobile/online banking applications?','The mobile and online banking apps support the following account types: Savings, Checking, Credit Cards, Loans, Deposits/Line of Credit','SID_ACTIVE','FAQ_CAT_ID2','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID8','CH_ID_MOB_INT','FAQ_732018174748','Can I update my name from the Mobile and Online banking apps?','No. You cannot update your name from the applications, but you can download the Name Change Request form from the online banking application that you can print and submit at the bank.','SID_ACTIVE','FAQ_CAT_ID8','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0),('FAQ_ID9','CH_ID_MOB_INT','FAQ_732018175949','Can I update my username and password for the mobile and online banking apps?','Yes, you can use the Profile section to update the username or password as needed from the mobile and online banking apps','SID_ACTIVE','FAQ_CAT_ID8','UID11','UID11','2018-09-05 16:36:07','2018-09-05 16:36:07','2018-09-05 16:36:07',0);
