INSERT  IGNORE INTO `messagetemplate` (`id`, `Name`, `Body`, `AdditionalInfo`, `createdby`, `modifiedby`, `creadtedts`, `lastmodifiedts`, `synctimestamp`, `softdeleteflag`) VALUES ('MSG_TEMPLATE_ID_01','Thank You Template','Hi <<CustomerName>>,<br><br>Kony Bank conveys a note of thanks for being it\'s customer.<br><br>Regards,<br><br><<Customer Service Rep Name>><br>Kony Bank','Thank You Template Additional Info','Kony User','Kony Dev','2018-02-15 13:31:10','2018-02-15 13:31:10','2018-02-15 13:31:10',0),('MSG_TEMPLATE_ID_02','Feedback Request Template','Hi <<CustomerName>>,<br><br>Please provide your feedback on your recent visit to our branch by visiting our website at your convenience.<br>','Feedback Request Template Additional Info','Kony User','Kony Dev','2018-02-15 13:31:10','2018-02-15 13:31:10','2018-02-15 13:31:10',0),('MSG_TEMPLATE_ID_03','Document Request Template','Hi <<CustomerName>>,<br><br>Please upload your ID proof via the mobile app or the browser for KYC verification.<br><br>Regards,<br><br><<Customer Service Rep Name>><br>Kony Bank','Document Request Template Additonal Info','Kony User','Kony Dev','2018-02-15 13:31:10','2018-02-15 13:31:10','2018-02-15 13:31:10',0),('MSG_TEMPLATE_ID_04','Address Verification Request Template','Hi <<CustomerName>>,<br><br>Please contact our customer service to schedule a address verification visit.<br><br>Regards,<br><br><<Customer Service Rep Name>><br>Kony Bank','Address Verification Request Template Additional Info','Kony User','Kony Dev','2018-02-15 13:31:10','2018-02-15 13:31:10','2018-02-15 13:31:10',0);
