INSERT  IGNORE INTO `adminnotification` (`Id`, `Name`, `Description`, `StartDate`, `ExpirationDate`, `Status_id`, `createdby`, `modifiedby`, `createdts`, `lastmodifiedts`, `synctimestamp`, `softdeleteflag`) VALUES ('NID1','Send Money - A new and better way to Pay','<html><Body><p> Introducing quick and easy way to send money to family and friends. All you need is their phone number or email id. ','2016-11-22','2019-02-22','SID_STARTINGSOON','Kony User','Kony Dev','2018-09-05 16:36:08','2018-09-05 16:36:08','2018-09-05 16:36:08',0),('NID10','Pay Bills - Pay Multiple Bills at Once','<html><Body><p>Select multiple billers and pay all your dues in one click!<br></p></body></html>','2016-11-22','2019-02-22','SID_N_ACTIVE','Kony User','Kony Dev','2018-09-05 16:36:08','2018-09-05 16:36:08','2018-09-05 16:36:08',0),('NID11','Deals - Mortgage Taxes & Insurance... Done!','<html><Body><p>Personal loans with rates as low as 3.74% APR**</p></body></html>','2016-11-22','2019-02-22','SID_N_ACTIVE','Kony User','Kony Dev','2018-09-05 16:36:08','2018-09-05 16:36:08','2018-09-05 16:36:08',0),('NID12','Deals - Go Paperless and win!','<html><Body><p>All e-Statement users will be eligible to win one of five$100 Visa gift cards! Enroll today!</br> Offer for limited period<br></p></body></html>','2016-11-22','2019-02-22','SID_EXPIRED','Kony User','Kony Dev','2018-09-05 16:36:08','2018-09-05 16:36:08','2018-09-05 16:36:08',0),('NID13','Loan - Loan Approved','<html><Body><p>Congratulations! Your Personal Loan Request has been approved. We will contact you shortly with more details</p></body></html>','2016-11-22','2019-02-22','SID_N_ACTIVE','Kony User','Kony Dev','2018-09-05 16:36:08','2018-09-05 16:36:08','2018-09-05 16:36:08',0),('NID14','Request Money - You have a new Request for Money','<html><Body><p> Someone has sent you a request for money.</br> Requests are valid for 14 days </br></p></body></html>','2016-11-22','2019-02-22','SID_STARTINGSOON','Kony User','Kony Dev','2018-09-05 16:36:08','2018-09-05 16:36:08','2018-09-05 16:36:08',0),('NID2','Pay Bill - You have received a new bill','<html><Body><p>You have received a new bill from CitiBank Credit Card. </br>Due Amount $1500</br></p></body></html>','2016-11-22','2019-02-22','SID_STARTINGSOON','Kony User','Kony Dev','2018-09-05 16:36:08','2018-09-05 16:36:08','2018-09-05 16:36:08',0),('NID3','Account Balance - Low Balance Alert','<html><Body><p> The balance for your Checking account is below $50<br> Please maintain sufficient funds to avoid penalty.<br></br><br></p></body></html>','2016-11-22','2019-02-22','SID_EXPIRED','Kony User','Kony Dev','2018-09-05 16:36:08','2018-09-05 16:36:08','2018-09-05 16:36:08',0),('NID4','Request Money - You have a new Request for Money','<html><Body><p> Someone has sent you a request for money.</br> Requests are valid for 14 days </br></p></body></html>','2016-11-22','2019-02-22','SID_N_ACTIVE','Kony User','Kony Dev','2018-09-05 16:36:08','2018-09-05 16:36:08','2018-09-05 16:36:08',0),('NID5','Pay Bill - You have received a new bill','<html><Body><p> You have received a new bill from CitiBank Credit Card. </br>Due Amount $1500<br></p></body></html>','2016-11-22','2019-02-22','SID_STARTINGSOON','Kony User','Kony Dev','2018-09-05 16:36:08','2018-09-05 16:36:08','2018-09-05 16:36:08',0),('NID6','Credit Card - Unlimited 1.5% Cashback with Freedom Unlimited credit card','<html><Body><p>$150 Bonus after you spend $500 on purchases in your first 3 months from account opening. No annual fee. 0% intro APR for 15 months from account opening on purchases and balance transfers.</br> T&C Apply</p></body></html>','2016-11-22','2019-02-22','SID_EXPIRED','Kony User','Kony Dev','2018-09-05 16:36:08','2018-09-05 16:36:08','2018-09-05 16:36:08',0),('NID7','Deals - Go Paperless and win!','<html><Body><p>All e-Statement users will be eligible to win one of five$100 Visa gift cards! Enroll today!</br> Offer for limited period<br></p></body></html>','2016-11-22','2019-02-22','SID_N_ACTIVE','Kony User','Kony Dev','2018-09-05 16:36:08','2018-09-05 16:36:08','2018-09-05 16:36:08',0),('NID8','Account - Giving You Motivation For Your Renovation!','<html><Body><p>No collateral is required and the loan amount lets you tackle projects without having to tap into your homes equity. Not only do interest rates start out lower than most average credit cards  as low as 8.49%, well even discount your APR* by up to 1.50%!</br> Up to 0.75% APR discount based on length of homeownership</p></body></html>','2016-11-22','2019-02-22','SID_STARTINGSOON','Kony User','Kony Dev','2018-09-05 16:36:08','2018-09-05 16:36:08','2018-09-05 16:36:08',0),('NID9','Balance - Account Balance','<html><Body><p> Account Balance <br> Your Account balance is low</br> Maintain minimum balance to avoid penalty<br></p></body></html>','2016-11-22','2019-02-22','SID_EXPIRED','Kony User','Kony Dev','2018-09-05 16:36:08','2018-09-05 16:36:08','2018-09-05 16:36:08',0);
