INSERT  IGNORE INTO `privacypolicy` (`id`, `Channel_id`, `Status_id`, `Description`, `createdby`, `modifiedby`, `createdts`, `lastmodifiedts`, `synctimestamp`, `softdeleteflag`) VALUES ('PRIV_POL_ID1',NULL,'SID_ACTIVE',' <p style=\"text-align: justify;\"><i><font face=\"Calibri\" size=\"3\" style=\"\">At Kony Bank, the safeguarding of your account information is our top priority.&nbsp;</font><span style=\"font-family: Calibri; font-size: medium;\">We strive to keep our members informed on current security issues, as well as providing the tools to help protect yourself. Please check back periodically to view new information as it becomes available.</span></i></p><p><b><font face=\"Calibri\" size=\"3\">Your account security</font></b></p><p><font face=\"Calibri\" size=\"3\">We protect your online <b>security</b>. Keeping financial and personal information about you secure and confidential is one of our most important responsibilities. Our systems are protected, so information remains secure.</font></p><p><span><span><font face=\"Calibri\" size=\"3\">1. </font></span></span><font face=\"Calibri\" size=\"3\">Computer virus protection detects and prevents computer viruses from entering our computer network systems.</font></p><p><span><span><font face=\"Calibri\" size=\"3\">2.</font><span> </span></span></span><font face=\"Calibri\" size=\"3\">Firewalls block unauthorized access by individuals or networks. Firewalls are just one way we protect our computer network systems that interact with the Internet.</font></p><p><span><span><font face=\"Calibri\" size=\"3\">3.</font><span> </span></span></span><font face=\"Calibri\" size=\"3\">Secure transmissions ensure information remains confidential. Kony Bank uses encryption technology such as Secure Socket Layer (SSL) on its Web sites to securely transmit information between you and the credit union.</font></p><p><span><span><font face=\"Calibri\" size=\"3\">4.</font><span> </span></span></span><font face=\"Calibri\" size=\"3\">Send secure e-mail to almost any department in the credit union through the Contact Us section. Because an Internet e-mail response back to you may not be secure, we will not include confidential account information in an e-mail response. In addition, you will never be asked for confidential information, such as passwords or PINs, through e-mail. Besides e-mail, you can contact us by phone or visiting any branch.</font></p><p><span><span><font face=\"Calibri\" size=\"3\">5.</font><span> </span></span></span><font face=\"Calibri\" size=\"3\">Regular evaluations of our security features and continuous research of new advances in security technology ensure that your personal information is protected.</font></p>','Kony User','UID11','2018-09-05 16:36:08','2018-09-05 16:36:08','2018-09-05 16:36:08',0);
/*!40000 ALTER TABLE `privacypolicy` ENABLE KEYS */;
UNLOCK TABLES;

