vacy</strong> Please refer to the privacy statement on our website or to our printed privacy policy for full details of our policy on protecting your personal and financial information. With respect to your use of Online Banking, Bill Payer External transfer Wire service, we will disclose information about your accounts and the transfers you make to third parties (a) when necessary to complete transfers; (b) to verify the existence and condition of your account for a third party such as a credit bureau or merchant; (c) to comply with a governmental agency or court order; (d) if you give us written permission; (e) if necessary to fulfill agreements between us and our third party Online Banking, Bill Payer and External transfer Wire service providers; or (f) if it involves a claim by or against us in connection with a deposit to or withdrawal from your account.<br /> </li><li><strong> Termination</strong> We can discontinue any services we offer, including Online Banking, Bill Payer or External transfer Wire service. . We will notify you at least 21 days in advance if we do this. We can cancel your use of Online Banking, Bill Payer or External transfer Wire service without notice if you default on any term of any agreement you have with Kony Bank. If you close your Bank accounts, or if you have not used Online Banking for 6 consecutive months, Online Banking will be discontinued. You can ask to terminate Online Banking and/or Bill Payer and/or External transfer Wire service at any time by submitting a request by mail, in person, or by e-mail. Termination of your Online Banking, Bill Payer or External transfer Wire service will not relieve you of your liability with respect to any transactions processed before the service was terminated.<br /> </li><li><strong> Business Days</strong> Our business days are Monday through Friday, excluding federal holidays.<br /> </li><li><strong> Changes in Terms</strong> We can change the terms of this Agreement by giving you at least 