ect to any agreement or court order to which we are not a party. No release from the obligations under this Agreement will be valid unless (a) in writing and signed by an authorized Bank employee or (b) pursuant to a court order in an action to which the Bank is a party. <strong>7. Security of Your Accounts</strong></li><li><strong>Your passcode:</strong>When you sign up for Online Banking, you will choose your own Access Identification Code (Access ID) and a Passcode. You will need both the Access ID and the Passcode to use the Service You are responsible for keeping your Access ID and Passcode secure. Refer to section 12 of this Agreement for information about your potential liability for unauthorized use of your accounts. Your Passcode is encrypted into our Online Banking database through Digital Insight. No person at Kony Bank or Digital Insight has access to your Passcode. No person at Kony Bank or Digital Insight is permitted to ask you for your Passcode. If any person requests your Passcode, please report the incident to us immediately. If you voluntarily give your Passcode to any person, you are authorizing that person to see any information and conduct any transaction on your accounts that you can see or conduct yourself. You are responsible for all transactions initiated by that person. That person\'s authorization to see and use your accounts continues until you change your Passcode.</li><li><strong>Log-On Security:</strong>Your session will be automatically logged off if you have reached your current timeout period without activity. This is to reduce the risk of unauthorized use if you inadvertently leave your computer unattended with Online Banking open. When you return to your computer, you will be prompted to re-enter your Passcode, and your session will continue where you left off.</li><li><strong>Security Technology:</strong>(i) Online Banking uses Secure Socket Layer (SSL) encryption. The system will typically warn you if your Internet Browser does