ntal, lease, timesharing, service bureau, or other arrangement; (iv) transfer any of the rights granted to you under this license; (v) work around any technical limitations in the Service, use any tool to enable features or functionalities that are otherwise disabled in the Service, or decompile, disassemble, or otherwise reverse engineer the Service except as otherwise permitted by applicable law; (vi) perform or attempt to perform any actions that would interfere with the proper working of the Service or Debit Rewards Offers or any services provided in connection with them, prevent access to or the use of the Service, Debit Rewards Offers or any or services provided in connection with them by other licensees or customers, or impose an unreasonable or disproportionately large load on the infrastructure while using the Service; or (vii) otherwise use the Service, Debit Rewards Offers or any services provided in connection with them except as expressly allowed under this Section 1.</p><p> <strong>OWNERSHIP. </strong> The Service and Debit Rewards Offers are protected by copyright, trade secret and other intellectual property laws. You do not have any rights to the trademarks or service marks.</p><p> <strong>YOUR INFORMATION AND ACCOUNT DATA WITH US. </strong> You are responsible for (i) maintaining the confidentiality and security of your access number(s), password(s), security question(s) and answer(s), account number(s), login information, and any other security or access information, used by you to access the Service, Debit Rewards Offers or any services provided in connection with them, and your accounts with us (collectively, \"Licensee Access Information\"), and (ii) preventing unauthorized access to or use of the information, files or data that you store or use in or with the Service, Debit Rewards Offers or any services provided in connection with them (collectively, \"Account Data\"). You are responsible for providing access and assigning passwords to other 